In triangle $ABC$, $AB = 11$, $AC = 13$, and $BC = 20$.  The medians $AD$, $BE$, and $CF$ of triangle $ABC$ intersect at the centroid $G$.  Let $P$ be the foot of the altitude from $G$ to $BC$.  Find $GP$.

[asy]
unitsize(0.3 cm);

pair A, B, C, D, E, F, G, P;

A = (44/5,33/5);
B = (0,0);
C = (20,0);
D = (B + C)/2;
E = (C + A)/2;
F = (A + B)/2;
G = (A + B + C)/3;
P = (G + reflect(B,C)*(G))/2;

draw(A--B--C--cycle);
draw(A--D);
draw(B--E);
draw(C--F);
draw(G--P);

label("$A$", A, dir(90));
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, SE);
label("$E$", E, NE);
label("$F$", F, NW);
label("$G$", G, NE);
label("$P$", P, SSW);
